                        Color = Properties.TextStrokeColor3,
                        LineJoinMode = Properties.LineJoinMode,
                        ApplyStrokeMode = Properties.ApplyStrokeMode,
                        Thickness = Properties.Thickness,
                        Transparency = Properties.TextStrokeTransparency,
                    })
                end

